// SideMenu.js
import React from 'react';

export default function SideMenu({ activeTab, setActiveTab }) {
  const tabs = [
    { id: 'chat', label: 'üí¨ Chat' },
    { id: 'inventory', label: 'üéí Inventory' },
    { id: 'task', label: 'üìù Tasks' }
  ];

  return (
    <div style={{ display: 'flex', borderBottom: '2px solid #ccc', backgroundColor: '#f0f0f0', padding: '10px' }}>
      {tabs.map(tab => (
        <div
          key={tab.id}
          onClick={() => setActiveTab(tab.id)}
          style={{
            marginRight: '15px',
            cursor: 'pointer',
            padding: '5px 10px',
            borderRadius: '4px',
            backgroundColor: activeTab === tab.id ? '#ddd' : 'transparent',
            fontWeight: activeTab === tab.id ? 'bold' : 'normal'
          }}
        >
          {tab.label}
        </div>
      ))}
    </div>
  );
}
